line_function = function(alpha, beta, theta) {
    return Math.exp(alpha * (theta - beta)) / (1 + Math.exp(alpha * (theta - beta)));
}

// X-Variable
data = d3.range(-3, 3, 0.1).map((theta) =&gt; ({
  x: theta,
  y1: line_function(alpha1, beta1, theta),
  y2: line_function(alpha2, beta2, theta)
}));

Plot.plot(
  {
    x: {grid: false, domain: [-3, 3]}, 
    y: {grid: false, domain: [0, 1]},
